\defbeamertemplate*{footline}{UNIVALLE theme}
{
  \leavevmode%

  \begin{beamercolorbox}[wd=\paperwidth,ht=1pt]{UNIVALLE rule}%
    \hrulefill%
  \end{beamercolorbox}\par%
  \hbox{%
    \begin{beamercolorbox}[wd=.4\paperwidth,ht=3.5ex,dp=1.15ex,center]{UNIVALLE logo}%
      \pgfdeclareimage[height=4.9ex]{UNIVALLE-logo}{UNIVALLE-logo}%
      \raisebox{-1.15ex}{\pgfuseimage{UNIVALLE-logo}}%
    \end{beamercolorbox}%
    \begin{beamercolorbox}[wd=.2\paperwidth,ht=3.5ex,dp=1.15ex,center]{UNIVALLE footer}%
      \usebeamerfont{page number in UNIVALLE foot}\insertframenumber{} / \inserttotalframenumber%
    \end{beamercolorbox}%
    \begin{beamercolorbox}[wd=.4\paperwidth,ht=3.5ex,dp=1.15ex,center]{UNIVALLE footer}%

     \pgfdeclareimage[height=4.9ex]{COLCIENCIAS-logo}{COLCIENCIAS-logo}%
      \raisebox{-1.15ex}{\pgfuseimage{COLCIENCIAS-logo}}%


       %\begin{beamercolorbox}[wd=.4\paperwidth,ht=1.5ex,dp=0.5ex,right,top]{UNIVALLE footer}%
         %\usebeamerfont{details in UNIVALLE foot}\@footlineupper{}\hspace*{2em}%
       %\end{beamercolorbox}%
       %\begin{beamercolorbox}[wd=.4\paperwidth,ht=1.5ex,dp=0.5ex,right,bot]{UNIVALLE footer}%
         %\usebeamerfont{details in UNIVALLE foot}\@footlinelower{}\hspace*{2em}%
       %\end{beamercolorbox}%
    \end{beamercolorbox}}%
  \vskip0pt%
}

\defbeamertemplate*{headline}{UNIVALLE theme}
{
  \leavevmode%
  \hbox{%
  \begin{beamercolorbox}[wd=.3\paperwidth,ht=3.5ex,dp=1ex,right]{section in head/foot}%
    \usebeamerfont{section in head/foot}\insertsectionhead\hspace*{2ex}
  \end{beamercolorbox}%
  \begin{beamercolorbox}[wd=.5\paperwidth,ht=3.5ex,dp=1ex,left]{subsection in head/foot}%
    \usebeamerfont{subsection in head/foot}\fontsize{40}{65}\hspace*{2ex}\insertsubsectionhead
  \end{beamercolorbox}%
   \begin{beamercolorbox}[wd=.2\paperwidth,ht=3.5ex,dp=1ex,center]{subsection in head/foot}%
   \pgfdeclareimage[height=4.9ex]{background_rigth_bot}{background_rigth_bot}%
    \raisebox{-1.15ex}{\pgfuseimage{background_rigth_bot}}%
    %\usebeamerfont{subsection in head/foot}\hspace*{2ex}\insertsubsectionhead
  \end{beamercolorbox}%
}\par%


%  \begin{beamercolorbox}[wd=\paperwidth,ht=2pt]{section in head/foot}%
